entry.string:
ISRUNNING='';
ATTEMPTS=20;
while [ -z "$ISRUNNING" ] && [ $ATTEMPTS -gt 0 ]; 
    do echo "Not completed..."; 
    helm upgrade scrapy-mylegion k8s/helm/ --set SPIDER_IMAGE=alexshrugged92/mylegion:8ca0ebd --set SPIDER_NAME=scrapy-mylegion --set SPIDER_REPLICAS=5 --set 5=5
    ISRUNNING="$(kubectl get job scrapy-job-scrapy-mylegion -o jsonpath='{.status}' | grep '"active":5' | grep 'ready":5')" || ISRUNNING='';
    ATTEMPTS=$((ATTEMPTS-1));
    sleep 5;
done;
